import React from "react";
import { Routes, Route } from "react-router-dom";
import Main from "./Components/Main";
import { useWindowSize } from 'react-use';

function App() {

	const { width } = useWindowSize();

	return (
		<div className='App'>
			<Routes>
				<Route path='/' element={<Main minWidth={width}/>}/>
			</Routes>
		</div>
	);
}

export default App;
